const cartItems = [
    {
      avatar: 'data:image/jpeg;base64,',
      name_eng: 'Kabuli Rice With Chicken',
      name_arb: 'أرز كابولي بالدجاج',
      price:'17',
      status:'preparing'    
    },

    {
      avatar: 'data:image/jpeg;base64,',
      name_eng: 'Karhai',
      name_arb: 'كرهاي',
      price:'17',
      status:'on the way'    
    },

    {
      avatar: 'data:image/jpeg;base64,',
      name_eng: 'Kabab',
      name_arb: 'كباب',
      price:'17',
      status:'pending'    
    },
    
  ]
export default class Cart extends Component {

  constructor(props) {
    super(props);
    this.state = {
      language: 'eng',
      orders: []
    };
    
  }

  componentDidMount () {
    AsyncStorage.getItem('language')
      .then(language => {
          
          if(language != null ){
            this.setState({language:language})
            console.log(language)
          }
        });
    this.backHandler = BackHandler.addEventListener('hardwareBackPress', this.handleBackPress);

    AsyncStorage.getItem('customer')

      .then(customer => {
        return JSON.parse(customer);
        })

      .then(customer => {
        const id=customer.id;
        this.setState({isLoading:true})
        Caller.callServer("getCustomerOrders","GET", [id])
          .then( response  => {
            return response.json()
          })
          .then ( data => {
            this.setState({orders:data});
            console.log("response-->",data);
            this.setState({isLoading:false})
            
          })
          
      });



    
  }

  handleBackPress = () => {
    console.log("Back Press");
    
      this.props.navigation.goBack(null);
    return true;
  }

  componentWillUnmount() {
    this.backHandler.remove();
  }

  cancelOrder(order){

    console.log(order);
    const id = order.id;
    Caller.callServer("deleteOrder","GET", [id])
            .then( response  => {
              console.log(response);
            })
            

  }



  renderFields = ({ item, index }) => {
    var icon='clock-time-two-outline';
    var color=DarkGrey;
    if (item.status=='4') {
      icon = 'car-hatchback';
      color = Orange;
    }
    else if (item.status=='2') {
      icon = 'chef-hat';
      color=Red;
    }
    else if (item.status=='5') {
      icon = 'check-circle';
      color='green';
    }
    else if (item.status=='3') {
      icon = 'chef-hat';
      color=Red;
    }
    
    const rider=item.rider;
    return (

      <TouchableOpacity 
        style={styles.cartItems}
        onPress={() => {this.props.navigation.navigate('ViewOrderDetails',{item,item})}}
      >

        <View style={{flexDirection:'row'}}>
          <Image
            style={{
              width: wp('20%'),
              height: wp('20%'),
              borderRadius:5,
              marginBottom:hp('1.5%')
            }}
            source={{uri:IP+"/storage/"+item.orders_item[0].pic_url}}
          />



          <View 
            style={{
              marginLeft:wp('4%'),
              marginTop:hp('1.5%')
            }}
          >
            {this.state.language == 'eng' ?
              <View style={{flexDirection:'row'}}>
                <Text style={{
                  color:Blue,
                  fontWeight:'bold'
                }}>
                  {item.orders_item[0].name_eng}
                </Text>

                {item.orders_item.length > 1 &&
                    <Text style={{
                      color:Blue,
                      fontWeight:'bold'
                    }}>
                       ...
                    </Text>
                }
              </View>
            :
              <View style={{flexDirection:'row',justifyContent:'flex-end'}}>

                {item.orders_item.length > 1 &&
                    <Text style={{
                      color:Blue,
                      fontWeight:'bold'
                    }}>
                        ...
                    </Text>
                }

                <Text style={{
                  color:Blue,
                  fontWeight:'bold',
                }}>
                  {item.orders_item[0].name_arb} 
                </Text>

              </View>
            }

            <View style={{flexDirection:'row'}}>
              {this.state.language == 'eng' ?

                <View style={{flexDirection:'row'}}>

                  <Text>
                    Status |  {item.status_eng}
                  </Text>
                  <Icon 
                    style={{alignSelf:'center',marginLeft:wp('4%')}}
                    name={icon}
                    size={wp('4%')}
                    color={color}
                  />

                </View>
                :
                <View style={{flexDirection:'row'}}>
                  <Icon 
                    style={{alignSelf:'center',marginRight:wp('4%')}}
                    name={icon}
                    size={wp('4%')}
                    color={color}
                  />
                  <Text>
                    {item.status_arb} |  الحالة
                  </Text>
                </View>
              }

              

            </View>

            {
              item.status == '4' &&
                <TouchableOpacity style={{
                  borderColor:DarkGrey,
                  padding:wp('1%'),
                  paddingVertical:hp('1%'),
                  // backgroundColor:'pink'
                }}
                onPress = {()=>{this.props.navigation.navigate('RiderDetails',{rider,rider})}}
                > 
                  {this.state.language == 'eng'?
                    <Text style={{color:DarkGrey}}>
                      Rider Details
                    </Text>
                  :
                    <Text style={{color:DarkGrey}}>
                      تفاصيل رايدر
                    </Text>

                  }
                </TouchableOpacity>
            }

            {
              (item.payment_status == 'pending' && item.status == '1') &&
                <TouchableOpacity style={{
                  borderColor:DarkGrey,
                  padding:wp('1%'),
                  paddingVertical:hp('1%'),
                  // backgroundColor:'pink'
                }}
                onPress = {()=>{this.cancelOrder(item)}}
                > 
                  {this.state.language == 'eng'?
                    <Text style={{color:Red}}>
                      Cancel Order
                    </Text>
                  :
                    <Text style={{color:Red}}>
                      الغاء الطلب
                    </Text>
                  }
                </TouchableOpacity>
            }
          </View>

          
        
        </View>

        <View style={{justifyContent:'flex-end',paddingHorizontal:wp('2%')}}>
          
          <Text style={{
            color:Orange,
            fontWeight:'bold',
            fontSize:wp('5%'),
          }}>
            {item.bill}  SR
          </Text>
        </View>

      </TouchableOpacity>

    );
  };

  render() {
    return (
      <View style={styles.container}>

        <View style={styles.header}>
          <View style={{flexDirection:'row'}}>
            <TouchableOpacity
              style={{
                width: 30,
                height: 30,
                justifyContent:'center',
                marginRight:wp('1%')
               }} 
              onPress={() => {this.props.navigation.goBack()}}
              
            >
              <Icon1 
                name={"left"}
                size={18}
                color={'rgba(255,255,255,1)'}
              />
            </TouchableOpacity>
            {this.state.language == 'eng' ? 
              <Text style={{
                color:'#fff',
                fontSize:wp('5%'),
                marginLeft:wp('2%')
              }}>
                My Orders
              </Text>
            :
              <Text style={{
                color:'#fff',
                fontSize:wp('5%'),
                marginLeft:wp('2%')
              }}>
                طلباتي
              </Text>
            }
          </View>
          
        </View>

        <ScrollView style={{}}>
          <FlatList
            data={this.state.orders}
            extraData={this.state}
            keyExtracstor={(item, index) => `${index}`}
            renderItem={this.renderFields}
            ItemSeparatorComponent={() => {
              return ( <View style={{ marginVertical: hp('2%')}} /> )
            }}
          />
        </ScrollView>
        
       {/*Loading Indicator*/}
        {this.state.isLoading && (
          <View style={[{backgroundColor: 'rgba(255,255,255,0.8)', position: 'absolute', top: 0, bottom: 0, left: 0, right: 0}, styles.center]}>
            <ActivityIndicator color={LightBlue} size="large" />
          </View>
        )} 

      </View>
    );
  }
}

